import React from 'react';
import Card from './Card';
import '../style.css'; 

const people = [
  { image: '/seb.jpg', name: 'Sebasitan Offneg책rdh Spliehs', position: 'CEO', link: 'https://www.linkedin.com/in/sebastian-offneg%C3%A5rdh-b904031a5/' },
  { image: '/dan.jpg', name: 'Daniel Wik', position: 'Kungj채vel', link: '' },

];

const CardsSection = () => {
  return (
    <div className="cards-container">
      {people.map((person, index) => (
        <Card key={index} image={person.image} name={person.name} position={person.position} />
      ))}
    </div>
  );
};

export default CardsSection;
